  false,\n\t\"url\": null,\n\t\"notes\": \"Shoreside production reports are mandatory
  reports submitted by shoreside and stationary floating processors that receive groundfish
  from federally permitted catcher vessels.  These reports document groundfish production
  in post-processed product weight by species, product type, and FMP region (i.e.,
  GOA or BSAI).  The weight of each species of fish is reported by product code (e.g.,
  fillets, minced fish, surimi, etc.).  The product weights can be converted to a
  pre-processed (round) weight of fish by expanding the product weight using product
  recovery rates (PRR). Standardized PRRs are published in Federal regulations for
  product types and species combinations (50 CFR 679 Table 3).  \",\n\t\"license_title\":
